 &lt;h1 id=&#34;厦门-待更新完成&#34;&gt;&lt;a href=&#34;#厦门-待更新完成&#34; class=&#34;headerlink&#34; title=&#34;厦门[待更新完成]&#34;&gt;&lt;/a&gt;厦门[待更新完成]&lt;/h1&gt;&lt;h2 id=&#34;前言：&#34;&gt;&lt;a href=&#34;#前言：&#34; class=&#34;headerlink&#34; title=&#34;前言：&#34;&gt;&lt;/a&gt;前言：&lt;/h2&gt;&lt;p&gt;记得大三的时候就一直想去海边，因为封校+疫情也没怎么去成。考完后，自己也是一直想出去走走，春节看了很多的旅游地方，挑了好久(制定旅游计划)后终于决定出发了，结果天气预报下一周的雨，只有被迫取消了。后面就是学校毕业设计开题答辩和春招忙了一段时间，最后解决后也是顺利出发，哈哈哈哈哈哈！&lt;/p&gt;
&lt;h2 id=&#34;第一天：&#34;&gt;&lt;a href=&#34;#第一天：&#34; class=&#34;headerlink&#34; title=&#34;第一天：&#34;&gt;&lt;/a&gt;第一天：&lt;/h2&gt;&lt;p&gt;大早上收拾行李，出门吃了小学就喜欢吃的米粉(味道真的好)，随后就坐上了摆渡车去新都的华桂路地铁站，天府机场真的好远，地铁做了2个多小时，人都麻了(途中因为担心赶不上飞机还忐忑了一会)。还有到了机场我左问西问快速解决(天府机场也好大，但是感觉配套还不是很完善)。&lt;/p&gt;
